import '../tour/Tour.css'
function Tour(props) {

  return (
    <div>
      {props.DATA3.map((tour) => (
        <div key={tour.id}>
          <h2>{tour.name}</h2>
          <img src={tour.image} alt={tour.name} />
        </div>
      ))}
    </div>
  );
}
